Matrix<12,6> diag_matrix_m( Matrix<12> W, Matrix<12,6> M ) {
	Matrix<12,6> M_out;
	for(int i=0; i<12; i++ ) {
		for(int j=0; j<6; j++ ) {
			M_out[i][j] = W[i][i]*M[i][j];
		}
	}
	
	return M_out;

}



Matrix<3> skew(Vector<3> v) {
	Matrix<3> S = Data(   0,	-v[2],	 v[1],		//Skew-symmetric matrix
						 v[2],	    0,	-v[0],
						-v[1],	 v[0], 	   0);
	return S;
}

Matrix<3> LMatrix(Matrix<3> R_d, Matrix<3> R_e) {
	return -0.5 * (skew(makeVector(R_d(0,0), R_d(1,0), R_d(2,0)))*skew(makeVector(R_e(0,0), R_e(1,0), R_e(2,0))) + skew(makeVector(R_d(0,1), R_d(1,1), R_d(2,1)))*skew(makeVector(R_e(0,1), R_e(1,1), R_e(2,1))) + skew(makeVector(R_d(0,2), R_d(1,2), R_d(2,2)))*skew(makeVector(R_e(0,2), R_e(1,2), R_e(2,2))));
}



Vector<4> MatToQuat(Matrix<3> Rot) {
	Vector<4> Quat;
	double tr = Rot[0][0]+ Rot[1][1]+ Rot[2][2];
	int ii;
	ii=0;
	if (Rot[1][1] > Rot[0][0]) ii=1;
	if (Rot[2][2] > Rot[ii][ii]) ii=2;
	double s;
	if (tr >= 0){
		s = sqrt((tr + 1));
		Quat[0] = s * 0.5;
		s = 0.5 / s;
		Quat[1] = (Rot[2][1] - Rot[1][2]) * s;
		Quat[2] = (Rot[0][2] - Rot[2][0]) * s;
		Quat[3] = (Rot[1][0] - Rot[0][1]) * s;
	}
	else {
		switch(ii) {
			case 0:
				s = sqrt((Rot[0][0]-Rot[1][1]-Rot[2][2]+1));
				Quat[1] = s * 0.5;
				s = 0.5 / s;
				Quat[2] = (Rot[1][0] + Rot[0][1]) * s;//Update pose estimation
				Quat[3] = (Rot[2][0] + Rot[0][2]) * s;
				Quat[0] = (Rot[2][1] - Rot[1][2]) * s;
			break;
			case 1:
				s = sqrt((Rot[1][1]-Rot[2][2]-Rot[0][0]+1));
				Quat[2] = s * 0.5;
				s = 0.5 / s;

				Quat[3] = (Rot[2][1] + Rot[1][2]) * s;
				Quat[1] = (Rot[0][1] + Rot[1][0]) * s;
				Quat[0] = (Rot[0][2] - Rot[2][0]) * s;
			break;
			case 2:
				s = sqrt((Rot[2][2]-Rot[0][0]-Rot[1][1]+1));
				Quat[3] = s * 0.5;
				s = 0.5 / s;
				Quat[1] = (Rot[0][2] + Rot[2][0]) * s;
				Quat[2] = (Rot[1][2] + Rot[2][1]) * s;
				Quat[0] = (Rot[1][0] - Rot[0][1]) * s;
			break;
		}
	}
	return Quat;
}



Vector<3> rotationQuatError(Matrix<4,4> Tbe_d, Matrix<4,4> Tbe_e) {

	Vector<4> q_e = MatToQuat( Tbe_e.slice<0,0,3,3>() );
	Vector<4> q_d = MatToQuat( Tbe_d.slice<0,0,3,3>() );

	return q_e[0]*q_d.slice<1,3>() - q_d[0]*q_e.slice<1,3>() - skew( q_d.slice<1,3>()) * q_e.slice<1,3>();
}



//tc = 0.005
//kp = 100
//ko = 50
void clik( Matrix<4> Td, Vector<6> dpath, Vector<12> q0, int itr_max, double err_max_p, double err_max_o, double  tc, float kp, double ko, Matrix<12> W_inv) {

	Vector<6> dot_X_d = dpath;
	Matrix<4> Tbe = q_dirKin_Tbe(q0);
	Matrix<6, 12> mJ = q_Jacobian(q0);
	Matrix<12,6> psinvJ;
	Matrix<12,6> diag = diag_matrix_m( W_inv, mJ.T() );
	Matrix<3> psinvL;
	Vector<12> q = q0;

	LU<6> lu_core_snake_null(mJ*diag);				
	psinvJ  = diag*lu_core_snake_null.get_inverse();
	Vector<12> dq;


	Vector<3> ep = makeVector(Td(0,3), Td(1,3), Td(2,3))-makeVector(Tbe(0,3), Tbe(1,3), Tbe(2,3));		
	Vector<3> eo = rotationQuatError(Td, Tbe);

	cout << "ep: " << ep << endl;
	cout << "eo: " << eo << endl;


	int itr=0;

	while(itr < itr_max && ( norm(ep) > err_max_p || norm(eo) > err_max_o ) ) {

		Matrix<3> L = LMatrix( Td.slice<0,0,3,3>(), Tbe.slice<0,0,3,3>() );
		if ( itr > 1 ) {
			dot_X_d = Zeros;
		}

		LU<3> bsvd_L(L);
		psinvL = bsvd_L.get_inverse();

		Vector<3> vp = kp*ep + dot_X_d.slice<0,3>();
		Vector<3> vo = psinvL*(L.T()*makeVector(dpath[3],dpath[4],dpath[5]) + ko*eo);

		cout << "vp: " << vp << endl;
		cout << "vo  " << vo << endl;

		dq = psinvJ*makeVector(vp[0], vp[1], vp[2], vo[0], vo[1], vo[2]);

		cout << "dq: " << dq << endl;
		cout << "psinvJ: " << endl << psinvJ << endl;
		q += dq*tc;


		Tbe = q_dirKin_Tbe(q);
		mJ = q_Jacobian(q);
		LU<6> lu_core(mJ*diag);				
		psinvJ  = diag*lu_core.get_inverse();

		ep = makeVector(Td(0,3), Td(1,3), Td(2,3))-makeVector(Tbe(0,3), Tbe(1,3), Tbe(2,3));		
		eo = rotationQuatError(Td, Tbe);

		itr++;
	}

	cout << "q: " << q << endl;
	cout << "Tbe: " << endl << Tbe << endl;

}

